import './App.css';
import React from 'react';
import { animate, motion } from "framer-motion"; 
import { BsFillArrowLeftCircleFill } from "react-icons/bs";
import { useState } from "react";



function App() {

  let [isOpen, setIsOpen] = useState(false);

  return (


    <div className='nav'>
        <motion.div animate={{x:-500}} className="box"> </motion.div>
        <btn class="menubtn" onClick={() => setIsOpen(!isOpen)}>

          <BsFillArrowLeftCircleFill className='menuicon' onClick={() => setIsOpen(!isOpen)}/>

        </btn>
    </div>
  );
}


export default App;
